import React from "react";
import axios from "axios";
import styledComponents from "styled-components";

const Wrapper = styledComponents.div`
display: flex;
width: 100vw;
height: 100vh;
align-items: center;
justify-content: center;
`;

function App() {
  return <Wrapper>Hi</Wrapper>;
}

export default App;
